define(["ui-toolbox"],function(e){var t=function(){test("Get an element by ID using the UI Toolbox",function(){var t=e.getElement("#testEl");ok(t!=null,"Element should be non-null")}),test("Get multiple elements from a single selector with the UI Toolbox",function(){var t=e.getAllElements(".jsBindMultiple");equal(t.length,3,"All three elements are found and returned")}),test("Set/Get an attribute to an element using the UI Toolbox",function(){var t=e.getElement("#testEl");e.setAttribute(t,"super-cool","yep");var n=e.getAttribute(t,"super-cool");equal(n,"yep","The attribute value should be the same as when set")})};return{run:t}});